import * as naveServices from "../libs/naveServices";

//Post
export const messageTopSecret = async (req,res) =>{

    //Destructuring
    let { satellites}  = req.body;

   //Obtengo el mensaje entre los satelites
   let mensaje = naveServices.getMessage(satellites);

   let distances = naveServices.transformDistances(satellites);

   let cords = await naveServices.getLocation(distances);

   //Verifico que no tenga error cords y mensaje
   if(!cords.error && !mensaje.error){

    let response = {
        position: {
            x: cords.x,
            y: cords.y
        } ,
        message: mensaje
    }

    res.status(200).json(response);
   }else{
    res.status(404);
   }


};


//Post y Get
export const topSecretSplit = (req,res) =>{

    res.json("get TopSecret_Split");

};

